import React from 'react';
import './Nav.css'

const Nav = () => {
    return (
        <div>
            <div>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </div>
        </div>
    );
}

export default Nav;
